/*

description:
  This Component is the top most component; holding two cards which function as a selector for the contents of anoher component ( the next <div>, in this case the one below. ).
  Each Card is formatted in BinaryCard and custom data can be fed into the array of objects exported from /data/binary_selections.js
*/
import React, { Component } from 'react';
import BSELECTIONS from '../data/binary_selections';
import { Container,Row } from 'reactstrap';

import BinaryCard from './BinaryCard';

export default class BinarySelector extends Component{
  constructor(props){
    super(props);
  }

  render(){
    return(


      <Row>

            {
              BSELECTIONS.map((each)=>{
                  return (
                      <BinaryCard key={each.id} selection={each} />
                  );
              })
            }

      </Row>



      );
    }
}
